export function last(values) {
    let result;
    for (const value of values) {
        result = value;
    }
    return result;
}
export function first(values) {
    let result;
    for (const value of values) {
        result = value;
        break;
    }
    return result;
}
export function forEach(values, callback) {
    for (const value of values) {
        callback(value);
    }
}
